(277, 350, 'SMA', 'Aisha Talitha Fahira', 'Icha', '0078670791', 'Bireuen', '2007-03-15', 'Islam', 'Aceh', 'Perempuan', 'B', '1', '3', 'Jl. Gayo, km 4,5.', '> 3 KM', 'Desa Glumpang Meujim jim, Kec. Juli', '', 'Bireuen', 'Aceh', 'Hasani', 'Palembang', '1971-08-16', 'S1/D4', 'Kepolisian RI (Polri)', '> Rp. 5.000.000', 'Jl. Mon Kuta Dusun Chik Dibalee', 'Desa Lambhuk, Kec. Ulee Kareng', '', 'Kota Banda Aceh', 'Aceh', '628116811107', 'Ira Safhira', 'Banda Aceh', '1976-12-11', 'S2', 'PNS', '> Rp. 5.000.000', 'Jl. Gayo, km 4,5.', 'Desa Glumpang Meujim jim, Kec. Juli', '', 'Bireuen', 'Aceh', '628116819311', 'SMP Sukma Bangsa Bireuen', '10107071', 'Jl. Sukma Cot Keutapang, Bireun Meunasah Dayah.', 'Bireuen', 'Aceh', 'Tifus', 'Tidak', 'Ya', 'Ya', 'Ya', 'Tidak', 'Ya', 'Ya', '1. Juara lomba nyanyi kategori solo di Sekolah Dasar.\r\n2. Mengikuti acara Kenduri Kebangsaan 2021.\r\n3. Mendapat sertifikat atas pencapaian nilai tertinggi kedua di ujian mata pelajaran Bahasa Inggris.\r\n4. Mendapat sertifikat atas pencapaian nilai tertinggi ketiga di ujian mata pelajaran Seni Budaya.\r\n5. Mendapat sertifikat penghargaan sebagai peserta Sukma Bangsa English Competition di cabang Singing English Song & Guessing Game', 'Karena metode belajarnya yang sesuai dengan saya, dan juga karena saya ingin meningkatkan kemampuan akademik & non akademik.', 'Sekolah Sukma Bangsa terkenal dengan 4 No, yaitu No Bullying, No Cheating, No Littering, dan No Smoking.\r\nSerta budaya 5S nya, yaitu Senyum, Sapa, Salam, Sopan, dan Santun.'),
(278, 443, 'SMA', 'Annisa Azhari Putri', 'Nisa', '0071983887', 'Bireuen', '2007-03-25', 'Islam', 'Aceh', 'Perempuan', '-', '3', '3', 'Jalan Cot Keutapang', '< 1 KM', 'Cot Keutapang, Jeumpa', '', 'Bireuen', 'Aceh', 'Azhari Nurdin', 'Peusangan', '1967-06-12', 'SMA', 'Wiraswasta', 'Rp. 2.500.000 s/d Rp. 5.000.000', 'Jalan Cot Keutapang', 'Cot Keutapang, Jeumpa', '', 'Bireuen', 'Aceh', '6285260144166', 'Dewi Lazuwarni', 'Bireuen', '1973-07-20', 'SMA', 'Ibu Rumah Tangga', '< Rp. 1.000.000', 'Jalan Cot Keutapang', 'Cot Keutapang, Jeumpa', '', 'Bireuen', 'Aceh', '6285274316140', 'SMP Sukma Bangsa Bireuen', '10107071', 'Cot Keutapang', 'Bireuen', 'Aceh', '-', 'Ya', 'Tidak', 'Tidak', 'Ya', 'Tidak', 'Ya', 'Ya', '1. Mendapatkan sertifikat the 2 best in craft dan the 3 rd best in sport education. \r\n2. Mendapatkan sertifikat the 3 rd best in craft. \r\n3. Mendapatkan sertifikat telah mengikuti magang di perpustakaan sekolah sukma bangsa bireuen. ', 'Karena, sekolah sukma mendukung bakat siswa baik di bidang akademik maupun non akademik, dan mendukung saya dlm pengembangan skill yg saya miliki serta berkarakter yang baik. ', 'Memiliki 5S dan 4 No, 5S yaitu senyum, salam, sapa, sopan, santun. 4 No yaitu no littering, no smoking, no bullying, no cheating. Dan sekolah sukma merupakan salah satu sekolah terbaik di Aceh. '),
